INSERT INTO {pre}goods (id, `name`, goods_no, model_id, sell_price, market_price, cost_price, up_time, down_time, create_time, store_nums, img, ad_img, is_del, content, keywords, description, search_words, weight, `point`, unit, brand_id, visit, favorite, sort, spec_array, exp, comments, sale, grade, seller_id, is_share) VALUES
(1, '飞利浦（PHILIPS）32PHF3056/T3 32英寸 高清LED液晶电视（黑色）', '1376591', 0, '1299.00', '1599.00', NULL, '2015-06-16 23:18:19', NULL, '2015-06-16 23:15:57', 100, 'upload/2015/06/16/554d82c3N5bf6ede3.jpg', NULL, 0, '<div class="content_tpl"><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-0" name="detail-tag-id-0" text="产品信息">   <div class="formwork_bt_dz">    <span>产品信息</span>    <span class="s2">Product Information</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_img"><img src="http://img20.360buyimg.com/vc/jfs/t832/344/469914967/491596/3fdcf215/55264d6aNe3e76b63.jpg" /></div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-2" name="detail-tag-id-2" text="产品特色">   <div class="formwork_bt_dz">    <span>产品特色</span>    <span class="s2">Selling Point</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_img"><img src="http://img20.360buyimg.com/vc/jfs/t826/348/116061038/174225/4c781aa1/550a9924N6da7b55e.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="http://img20.360buyimg.com/vc/jfs/t700/210/1228277917/435622/3b60625a/55264db8Nee0e7f08.jpg" /></div></div><div class="formwork"><div class="formwork_text">逐点高清 细腻画质 秉承飞利浦对于高清画质处理技术的精益求精，先进的逐点高清技术，能显著提升图像质量，通过对画面像素进行逐点优化，使画面细节分毫毕现，再现真实色彩，带来更细腻出众的影像画质。</div></div><div class="formwork"><div class="formwork_img"><img src="http://img20.360buyimg.com/vc/jfs/t817/28/477809371/290244/f9f19cc2/55264dddN7367a68e.jpg" /></div></div><div class="formwork"><div class="formwork_text">环绕音效 如临现场 飞利浦超宽环绕立体声通过电子和声学原理处理信号，无需额外的音响就可模拟环绕立体声效果，使您欣赏到层次丰富的立体声和身临其境般的虚拟环绕声效。</div></div><div class="formwork"><div class="formwork_img"><img src="http://img20.360buyimg.com/vc/jfs/t1267/32/475069157/382686/6ab66a0a/55264dfeNf109f4a3.jpg" /></div></div><div class="formwork"><div class="formwork_text">晶晰声效 通过晶晰声效的特别处理，表现出更多的细节，无论是潺潺的流水声还是轻细的谈话声都非常清晰。</div></div><div class="formwork"><div class="formwork_img"><img src="http://img2