(209, '海外直采 意大利进口 卡维留里 蓝布鲁斯科 甜桃红 低泡葡萄酒 750ml', '493626', 0, '86.00', '100.00', NULL, '2016-01-22 16:07:58', NULL, '2016-01-22 16:08:02', 100, 'upload/2016/01/22/55ac9689Ncc876cf1.jpg', NULL, 0, '<div class="content_tpl"><div class="formwork_bt"><div class="formwork_bt_rb"><span>产品信息</span><span class="s2">Product Information</span></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t121/181/4934341216/12951/19019e0/537cbf6cN4e0e9b30.jpg" alt="" /></div></div><table align="center" border="0" cellpadding="0" cellspacing="6" width="750">  <tbody><tr>    <td><img src="//img20.360buyimg.com/vc/jfs/t10/275/4875385117/63161/8e3efd9c/537d7442N1702ebb5.jpg" alt="" /></td>    <td><p class="formwork_titleleft">卡维留里蓝布鲁斯科甜桃红低泡葡萄酒</p><p class="formwork_titleleft2"></p><div></div><div></div><div>类型： 甜桃红低泡</div><div> </div><div>葡萄品种： 蓝布鲁斯科 原产国：意大利 </div><div> </div><div>葡萄酒产区： 摩德纳产区 保质期： 5年</div><div> </div><div>原料： 葡萄汁 二氧化硫 酒精度： 7.5%vol</div><div> </div><div>储存方法： 避晒、平放 试饮温度：5-8度</div><div> </div><div>酒品介绍：味道甜美,爽口,清新自然,无干酒酸涩口味,易饮用。</div><div></div><div></div><p></p></td>  </tr></tbody></table><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t205/228/57887841/11674/3a38bb29/537d761fN13f16c23.jpg" alt="" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t82/101/4864318428/117341/e4791e75/537d84bdN88264b8e.jpg" alt="" /></div></div><div class="formwork"><div class="formwork_titleleft">瓶口细节</div><div class="formwork_text">使用橡木瓶塞，使得酒质更醇厚圆润，柔化、稳定酒的颜色</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t61/8/4872153722/299924/c4840bdb/537d8513Nade13761.jpg" alt="" /></div></div><div class="formwork"><div class="formwork_text">微微泛黄的酒标尽显历史沉淀感，烫金工艺设计尽显大气之感</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t163/48/69282194/145983/58a36275/537d8541N2a02690a.jpg" alt=