56798946/101572/7316baa0/549a182bN25516b61.jpg" /></div></div><div class="formwork"><div class="formwork_text">有芬芳的果香，醇厚协调，余味悠长是中西佳肴理想的佐餐葡萄酒 </div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-11" name="detail-tag-id-11" text="实景展示">   <div class="formwork_bt_rb">    <span>实景展示</span>    <span class="s2">Virtual show</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t613/280/951510435/287765/c0fa3e17/549a1850N436aed99.jpg" /></div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-13" name="detail-tag-id-13" text="食用说明">   <div class="formwork_bt_rb">    <span>食用说明</span>    <span class="s2">Edible Method</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t637/208/923402750/379206/81179538/5497d1f9Ndef14554.jpg" /></div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-15" name="detail-tag-id-15" text="产品特色">   <div class="formwork_bt_rb">    <span>产品特色</span>    <span class="s2">Selling Point</span>   </div>  </div> </body></html><table width="750" border="0" align="center" cellpadding="0" cellspacing="6">  <tr>    <td><img src="//img20.360buyimg.com/vc/jfs/t769/297/252894189/77982/7b7b1984/549a1889N67c4b7c9.jpg" /></td>    <td><p class="formwork_titleleft">河北沙城&middot;怀涿盆地</p><p class="formwork_titleleft2">创建于1983年的中国长城葡萄酒有限公司，地处河北省沙城。河北沙城怀涿盆地位于北纬40&deg;4&prime;－40&deg;35&prime;，东经115&deg;16&prime;－115&deg;58&prime;之间，正处于世界种植葡萄北纬40&deg;的&ldquo;黄金地带&rdquo;，与法国波尔多同处一个纬度线上, 是我国理想的葡萄酒原料基地之一。这里日照时间长、昼夜温差大、降雨量少，十分有利于葡萄的生长；其独有的砂质土壤也利于葡萄养分储存；干燥的气候以及季风使得葡萄的病虫害少、不易感染杂菌。得天独厚的地理条件，使得河北沙城成为我国酿造葡萄酒的最佳产区。公司拥有优质原料基地15万亩，其产品曾先后荣获80多个国际、国家金银奖，被中国绿色食品发展中心指定为&ldquo;绿色食品&rdquo;。</p></td>  </tr></table><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-17" name="detail-tag-id-17" text="品牌介绍">   <div class="formwork_bt_rb">    <span>品