(214, '张裕特选级窖藏干红葡萄酒750ml*6', '1477321', 0, '338.00', '435.00', NULL, '2016-01-22 16:08:00', NULL, '2016-01-22 16:08:10', 100, 'upload/2016/01/22/5566b90eN88ff1ca8.jpg', NULL, 0, '<div class="content_tpl"><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1717/199/686642924/295895/f06a172e/55d686e4N4beb2871.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1639/218/759130059/144949/d4f5e5b8/55d686ecN792b9750.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t2065/285/522124656/249441/5c18b08/56149309Nf3d12a3d.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t2182/54/106801364/134217/6d760eb2/55efa111N1cb420e0.jpg" /></div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-4" name="detail-tag-id-4" text="产品展示">   <div class="formwork_bt_rb">    <span>产品展示</span>    <span class="s2">Products Exhibition</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1471/53/229974002/87166/89794dd8/5566a394N09dcd1d8.jpg" /></div></div><div class="formwork"><div class="formwork_text">张裕特选级窖藏干红葡萄酒是一款性价比较高的酒，口味不仅有清新的酸，圆润的甜，葡萄的香，橡木的味，包装则是精心设计，精美张裕LOGO以及图案彰显了张裕的文化品牌内涵，使送礼更高档、更有面子。</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1264/197/993870532/51457/943fa80d/5566a502N836ff23b.jpg" /></div></div><div class="formwork"><div class="formwork_text">张裕窖藏特选级干红，复古韵味的圆筒包装，更加大气、典雅。</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1504/116/231772109/44589/c782aec3/5566a515Ned8a3e8b.jpg" /></div></div><div class="formwork"><div class="formwork_text">张裕窖藏特选级干红整箱有六瓶，每瓶有单独的圆筒，同时整箱里面有3个两只装的精美礼品袋，既适合自我小酌，同时也是走亲访友、馈赠亲友的佳品。</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1663/207/23771201/78163/314a3037/5566a491N3d009640.jpg" /></div></div><div class="formwork"><div class="formwork_text">张裕窖藏干红葡萄酒分为特选级、优选级和普通窖藏干红三种。其中张裕窖藏特选级干红等级较高，口味更加醇厚，口感圆润饱满，酒体丰满，典型性好。</div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-13" name="detail-tag-id-13" text="产品信息">   <div class="formwork_bt_rb">    <span>产品信息</span>    <span class="s2">Product Information</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1012/298/1028572349/55665/750a666b/5566a4e5Nc95d0f6c.jpg" /></div></div><div class="formwork"><div class="formwork_text">本品果香浓郁，酒香优雅，典型性强。精雅的葡萄酒轻盈、平衡良好而柔和。</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t943/49/1016544044/78114/f68ab7ea/5566a4f3N2d2a3b7b.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t949/286/1023016830/30558/122c9bf5/5566a520N11d74b46.jpg" /></div></div><div class="formwork"><div class="formwork_text">本品含有三个两只装的礼品袋，整箱不仅价格实惠，同时也是走亲访友的上乘之品</div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1312/239/327988368/83444/aa03b752/5566a4a1N69882639.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1834/88/590927550/172621/f683a83a/55d5823fNbb29ab3f.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1792/203/1019596865/260527/4cfb6894/55dffaf3N106028bc.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1726/363/678059353/196961/7b371a8f/55d5824cN88cd9e4b.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1651/288/490911153/215387/94dc21a5/55d58255N545443ab.jpg" /></div></div><div class="formwork"><div class="formwork_img"><img src="//img20.360buyimg.com/vc/jfs/t1753/248/676193166/71040/ac3d988a/55d5825fN1636358d.jpg" /></div></div><html> <head></head> <body>  <div class="formwork_bt" id="detail-tag-id-25" name="detail-tag-id-25" text="温馨提示">   <div class="formwork_bt_dz">    <span>温馨提示</span>    <span class="s2">Kindly Remind</span>   </div>  </div> </body></html><div class="formwork"><div class="formwork_text">1、本网站不向未成年人销售酒类商品！2、特别说明：由于库存流动较大，生产日期以实际收到为准！</div></div></div><br/>', NULL, NULL, NULL, '500.00', 0, '件', NULL, 0, 0, 99, NULL, 0, 0, 0, 0, 0, 0),
